import React from 'react';

const Sobre = () => {
  return (
    <section id="sobre" className="sobre-secao">
      <div className="container content-block text-center">
        <h2 className="titulo-secao">Sobre Nós</h2>
        <p className="texto-sobre">
          Somos alunos da UNAMA fazendo um site abordando a tematica COP30, se tiver alguma dica ou sugestão, entre no nosso grupo do Whatsapp e fique a vontade para dar dicas do que podemos melhorar.
        </p>
        {/* Lembre-se de substituir 'SEU_LINK_DO_GRUPO' pelo link real */}
        <a href="https://chat.whatsapp.com/SEU_LINK_DO_GRUPO" target="_blank" rel="noopener noreferrer" className="btn-whatsapp">
          <i className="fab fa-whatsapp"></i> Entrar no Grupo do WhatsApp
        </a>
      </div>
    </section>
  );
};

export default Sobre;
